import React, { Component } from "react";
import "./style.css";
import Wicker from "./wicker.jpg"

class MovieInfo extends Component {


    render() {
        return (
           <div className="page">
                <img className="result-poster" src={Wicker}></img>
                <div className="card-text">
                    <div className="card-title">
                        <h1>
                            <span className="movie-name">The Wicker Man</span>
                        </h1>
                            
                        <h2>(<span className="movie-year">1973</span>)</h2>
                    </div>
                    <div className="card-ratings">
                        <h3>[ratings will go here]</h3>
                    </div>
                    <h3>Overview:</h3>
                    <p><span className="movie-overview">Police sergeant Neil Howie is called to an island village in search of a missing girl whom the locals claim never existed. Stranger still, however, are the rituals that take place there.</span></p>
                <div className="add-buttons">
                    <button className="add-watched">Watched</button>
                    <button className="add-to-watch">To Watch</button>
                </div>
                
                </div>
                
                
           </div> 
        );
    }
}

export default MovieInfo;
